import React from 'react';
import Triador from './Triador'
import Login from './Login';
import { Container,Nav} from 'react-bootstrap';
import { Route, Link} from 'react-router-dom';

function App() {
  return (

        <Container fluid>
           <Nav >
              <Nav.Item>
                    <Route
                        path="/login"
                        render={() => (
                          <div>
                            <h1>Dashboard</h1>
                            <Link to="/login" id="click-me">
                              Login
                            </Link>
                          </div>
                        )}
                      />
                </Nav.Item>
            </Nav>


        <Login />
      </Container>

  );
}

export default App;
